public V load(K key) throws CacheLoaderException {
  try {
    CacheRequest<K, V> query = (CacheRequest<K, V>) key;
    assert query != null;
    return query.getValue();
  } catch (Throwable ex) {
    throw new CacheLoaderException(ex);
  }
}
